enne undersektion bør du liste, hvilke trediemands betalingskortformidlere, som du anvender til at modtage betalinger i din webshop, da disse håndterer kundedata. Vi har indsat PayPal som et eksempel, men du bør fjerne dette, hvis du ikke anvender PayPal.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Vi deler information med trediemandsfirmaer, som hjælper os med at håndtere vores ordrer og services til dig; for eksempel --','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'I denne sektion bør du liste hvem, du deler information med og til hvilket formål. Det kunne omfatte, men ikke nødvendigvis være begrænset til analyser, markedsføring, betalingsløsninger, forsendelsesfirmaer, og trediemands programmer.','What we share with others'=>'Hvilke informationer vi deler med andre','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Vores medarbejdere har adgang til denne information for at kunne gennemføre ordrer, håndtere refunderinger og supportere dig.','Customer information like your name, email address, and billing and shipping information.'=>'Kundeinformation såsom dit navn, e-mailadresse samt information om fakturering og forsendelse.','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Ordreinformation såsom hvad der blev købt, hvornår det blev købt og hvortil, det skulle sendes, og','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Medarbejdere har adgang til informationen, som du giver os. Fx har administratorer såvel som webshopledere adgang til: ','Who on our team has access'=>'Hvilke medarbejdere der har adgang','We will also store comments or reviews, if you choose to leave them.'=>'Vi vil også gemme kommentarer og anmeldelser, hvis du ønsker at tilføje dem.','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Generelt gemmer vi information om dig så længe, som vi har behov for informationen til de formål, for hvilke vi indsamler og bruger informationerne, og vi er ikke juridisk forpligtet til at fortsætte med at gemme dem. Fx vil vi gemme ordreinformationer så længe det er krævet ifølge regnskabsloven i forhold til moms og regnskab. Dette inkluderer dit navn, e-mailadresse samt faktureringsadresse og leveringsadresse.','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Hvis du opretter en konto, vil vi gemme dit navn, adresse, e-mailadresse og telefonnummer, som vil blive anvendt til at udfylde indtastningsfelter ved bestilling af ordrer fremover.','Send you marketing messages, if you choose to receive them'=>'Sender dig markedsføringsbeskeder, hvis du vælger at modtage dem','Improve our store offerings'=>'Forbedre vores tilbud i webshoppen','Comply with any legal obligations we have, such as calculating taxes'=>'Overholder alle juridiske forpligtelser, som vi har, såsom beregning af moms og gebyrer','Set up your account for our store'=>'Opsæt din konto til vores webshop','Process payments and prevent fraud'=>'Behandle betalinger og forhindre svig','Respond to your requests, including refunds and complaints'=>'Svar på dine henvendelser og forespørgsler, herunder refunderinger og klager','Send you information about your account and order'=>'Sender dig information om din konto og ordre','When you 