ersion','WooCommerce version'=>'WooCommerce version','Settings tab labelPayments'=>'Betalinger','Enable coupons'=>'Aktivér rabatkuponer','Rates will be configurable and taxes will be calculated during checkout.'=>'Satser kan konfigureres og moms vil blive beregnet ved betaling på siden Kasse.','Enable tax rates and calculations'=>'Aktivér momssatser og beregninger','Manage'=>'Administrer','Account endpoints'=>'Konto slutpunkter','Secure checkout'=>'Sikker betaling','Legacy API'=>'Forældet API','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Opbevar gennemførte ordrer i en specificeret periode inden personoplysningerne i ordrene bliver anonymiseret.','Retain completed orders'=>'Opbevar gennemførte ordrer','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Annullerede ordrer er ubetalte og er muligvis blevet annulleret af webshopejeren eller kunden. De vil blive smidt ud ved udgangen af den specificerede periode.','Retain cancelled orders'=>'Behold annullerede ordrer','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Mislykkede ordrer er ubetalte og er muligvis blevet opgivet af kunden. De vil blive smidt ud ved udgangen af den specificerede periode. ','Retain failed orders'=>'Opbevar mislykkede ordrer','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Igangværende ordrer er ubetalte og er muligvis blevet opgivet af kunden. De vil blive smidt ud ved udgangen af den specificerede periode.','Retain pending orders '=>'Behold igangsværende ordrer','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Inaktive kundekonti er de kunder, som ikke har logget in, e