icy. The privacy notices below will not show up unless a %s is set.'=>'Denne del styrer og viser din webshops politik for personoplysninger. Informationer om personoplysninger nedenfor bliver ikke vist, med mindre %s er opsat forinden.','Privacy policy'=>'Politik for personoplysninger','Removed personal data from %s order.'=>'Fjernet personoplysninger fra %s order.' . "\0" . 'Fjernet personoplysninger fra %s ordrer.','Account erasure requests'=>'Anmodning om sletning af konto','Accounts &amp; Privacy'=>'Konti &amp; personoplysninger','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Liste med tilladte e-mails til kontrol af kundefakturerings-e-mail, når en bestilling bliver afgivet. Separér e-mailadresser med kommaer. Du kan også bruge en stjerne (*) for at sammenligne dele af en e-mailadresse. Fx vil "*@gmail.com" matche alle gmail adresser.','Allowed emails'=>'Tilladte e-mails','Filter by registered customer'=>'Filtrer på registrerede kunder','Remove personal data'=>'Fjern persondata','Use previous column mapping preferences?'=>'Anvend forrige kolonnetilknyttede preferencer?','View &amp; Customize'=>'Se &amp; tilpas','Review Settings'=>'Anmeldelse indstillinger','Visit Dashboard'=>'Gå til kontrolpanel','You can also:'=>'Du kan også:','You\'re ready to add products to your store.'=>'Du er nu klar til at oprette varer til din webshop.','Create some products'=>'Opret nogle varer','Continue with WooCommerce Services'=>'Fortsæt med WooCommerce Services','Connect your store to activate WooCommerce Services'=>'Forbind din webshop for at aktivere WooCommerce Services','Thanks for using Jetpack! Your store is almost ready: to activate services like %s, just connect your store.'=>'Tak for at anvende Jetpack! Din webshop er næsten klar: for at aktivere services som %s, skal du bare forbinde di